import logo from './logo.svg';
import './App.css';

function Header(){
  return <header>
    <h1><a href="/">Endless Creation</a></h1>
  </header>
}

function Nav(){
  return <Nav>
    <ul>
      <li><a href="/read/1">Home</a></li>
      <li><a href="/read/2">About Us</a></li>
      <li><a href="/read/3">Members</a></li>
      <li><a href="/read/4">Recruit</a></li>
    </ul>
  </Nav>
}

function Article(){
  return <Article>
    <h2>Welcome</h2>
    Hello, Web
  </Article> 
}

function App() {
  return (
    <div>
      <img src="public/ECmark.png" alt="ECmark"></img>
      <Header></Header>
      <Nav></Nav>
      <Article></Article>
    </div>
  );
}

export default App;
